import React, { Component } from 'react';
import { View } from 'react-native';
import { Input, Text,Button } from 'react-native-elements';

 const AddNewClub =()=> {
    return(
    <View style={{
      textAlign:'center',
      flex: 1,}}>
      <Text style={{ marginBottom: 8,
      textAlign:'center'
      }} h3>
         Ajouter un nouveau club
      </Text>
       <Input
        placeholder='Name'
      />
       <Input
        placeholder='Pays'
      />
       <Button
                title={'submit'}
                containerStyle={{
                  width:150,
                  marginHorizontal: 50,
                  marginVertical: 10,
                  marginLeft:50,
                }}
                onPress={()=>navigation.navigate('AddNewClub')}
              />
    </View>);
}

export default AddNewClub;
